import React, { Component } from 'react';
import Base from './base';
import 'jquery'

const Friends = () => {
  $.ajax({
    url: "https://app165.acapp.acwing.com.cn/myspace/userlist/",
    type: "GET",
    success(resp) {
      console.log(resp)
    }
  })

  return ( 
    <Base>
      <h6>Friends</h6>
    </Base>
  );
}

export default Friends
